import "./ExpenseItem.css";

function ExpenseItem() {
  return (
    <div className="expense-item">
      <div>May 6, 2021</div>
      <div className="expense-item_description">
        <h2>Bike Insurance</h2>
        <div className="expense-item__price">$40</div>
      </div>
    </div>
  );
}
export default ExpenseItem;
